import React, { Component } from "react";
import Background1 from '../images/banner1.jpg';

export default class Banner extends Component {
  render() {
    return (
      <div style={{ display: "flex" }}>
        <div
          style={{
            backgroundImage: "url(" + Background1 + ")",
            height: "100vh",
            width: "25%",
            border: "1px solid gray",
          }}
        >
            <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Aliquid, optio error repellat esse voluptate a doloremque natus maxime nobis, dicta soluta adipisci rerum. Dicta veritatis vitae, ipsum distinctio exercitationem corporis.</p>
        </div>
        <div
          style={{
            backgroundColor: "blue",
            height: "100vh",
            width: "25%",
            border: "1px solid gray",
          }}
        >
        </div>
        <div
          style={{
            backgroundColor: "red",
            height: "100vh",
            width: "25%",
            border: "1px solid gray",
          }}
        ></div>
        <div
          style={{
            backgroundColor: "green",
            height: "100vh",
            width: "25%",
            border: "1px solid gray",
          }}
        ></div>
      </div>
    );
  }
}
